import React, { useState } from 'react'
import Card from '../components/Card'

function AbonosStolovi() {
  const [isOpen, setIsopen] = useState(false)

  const toggleForm = () => setIsopen(!isOpen)

  return (
    <>
      <button onClick={toggleForm}>+</button>
      {isOpen &&
        <form className="form">
          <button className="close-btn">&#10005;</button>
          <div className="all-inputs">
            <input className="input" placeholder="Ime proizvoda" />
            <input className="input" placeholder="Materijali" />
            <input className="input" type="file" />
            <textarea className="input" placeholder="Opis" />
            <button className="form-button">SPREMI</button>
          </div>
        </form>
      }
      <div className="gallery">
        <Card />
        <Card />
        <Card />
        <Card />
      </div>
    </>
  );
}

export default AbonosStolovi;
